import React from 'react';

export default function NewlineText(props) {
    const text = props.text;
    console.log(text);
    // const newText = text.split('\n').map(str => <p>{str}</p>);
    const newText = text.split('\n').map((item, key) => {
        <p key={key}>{item}</p>
    });

    return newText;
}
